title":""},{"id":"0c7890cc-f7cf-4092-8bb8-5c93a15c3789","bounds":[[61.8689914280421,6.523320440319368],[61.832953511215635,6.674382452038118]],"basemap":{"type":"tiles","url":"https://mt2.google.com/vt/lyrs=s&x={x}&y={y}&z={z}","minZoom":0,"maxZoom":20,"attribution":"&copy; <a href=\\"https://www.google.com/intl/no_no/help/terms_maps/\\">Google Maps</a>"},"bookmark":false,"title":""}],"textboxes":[{"id":"a85ae688-f079-44b3-a823-38d67ecebad6","sceneId":"445531df-a411-40d6-b0a5-a452ea15a437","locked":true,"pos":[0.13125,0.24192415730337077],"dim":[0.2867045454545455,0.4635359550561798],"content":"<h1 style=\\"text-align: center;\\">Skogstad Sport</h1><p style=\\"text-align: center;\\">Skogstad har helt siden 1937 laget attraktive sport- og fritidsklær til hele familien. Vi har høyt fokus på miljø, etikk, des<span style=\\"background-color: initial; font-weight: var(--bs-body-font-weight);\\">ign, kvalitet, funksjonalitet, til fornuftige priser. Vår visjon er å være best på dette og skape uteglede for folk flest med trygghet om at klærne holder seg i generasjoner i alle aktiviteter og i alle typer vær de er designet for.</span></p><p style=\\"text-align: center;\\"><img src=\\"https://geotales.io/assets/img/62458bcf62a47.jpeg\\" style=\\"width: 100%; max-width: 442px; height: auto; max-height: 206px;\\"></p>"},{"id":"9b745636-1c3d-41c3-809e-035732d1c779","sceneId":"78feebfe-40c9-43f2-b220-1c69c19a35fa","locked":true,"pos":[0.175,0.2003511235955056],"dim":[0.28306477272727276,0.4320752808988764],"content":"<h1 style=\\"text-align: center;\\"></h1><p style=\\"text-align: center;\\"><span style=\\"background-color: initial; font-weight: var(--bs-body-font-weight);\\"></span></p><h1 style=\\"text-align: center;\\">&nbsp;Innvik Fruktlager SA</h1><p style=\\"text-align: center;\\">Ein medlemseigd samvirkeorganisasjon som har som hovedoppgave å motta og omsette frukt, bær og grønt frå våre produsentar. Innvik Fruktlager har røtter så langt tilbake som i 1952, men har eksistert i dagens form frå 1998.</p><p style=\\"text-align: center;\\"><img src=\\"https://geotales.io/assets/img/62458e4b0c581.jpeg\\" style=\\"width: 100%; max-width: 268px; height: auto; max-height: 182px;\\"></p>"},{"id":"d7b03fa4-0531-4ea9-975b-be28207daedb","sceneId":"12278ec9-1e4f-481e-83d5-5098b3d8b5ef","locked":true,"pos":[0.175,0.2003511235955056],"dim":[0.28306477272727276,0.4320752808988764],"content":"<p style=\\"text-align: center; \\"><h1>IRAS - Innvik Rekneskapsservice AS</h1>Våre medarbeidarar er kunnskapsrike og har lang og relevant erfaring. Vi held oss oppdaterte innan rekneskapsfaget, slik at kundane våre kan føle seg trygge på arbeidet vi utfører.&nbsp;<br><img src=\\"https://geotales.io/assets/img/6245a06090480.png\\" style=\\"width: 100%; max-width: 200px; height: auto; max-height: 198px;\\"><br><br></p>"},{"id":"05e3d4aa-021e-49b7-87c2-1f8d5e0cc4c9","sceneId":"096f41a7-5d99-4da6-995d-dccf2ad43443","locked":true,"pos":[0.175,0.2003511235955056],"dim":[0.28306477272727276,0.4320752808988764],"content":"<p><br></p><h1 style=\\"text-align: center; \\">Innvik AS</h1><p style=\\"text-align: center; \\">Innvik er en av de ledende produsenter av høykvalitets møbeltekstiler i Skandinavia. Våre fokusområder er produktutvikling, kvalitet og logistikk.&nbsp;&nbsp;</p><p style=\\"text-align: center; \\"><img src=\\"https://geotales.io/assets/img/62459469efdb8.jpeg\\"><br></p>"},{"id":"70031c89-af3f-4c79-8e50-85ac27bab150","sceneId":"cced5a0f-96f1-41ba-b6fd-d2712670eb7d","locked":true,"pos":[0.175,0.2003511235955056],"dim":[0.28306477272727276,0.4320752808988764],"content":"<h1 style=\\"text-align: center; \\">Innvik Fjordhotell</h1><h1 style=\\"text-align: center; \\"></h1><p style=\\"text-align: center; \\"></p><p style=\\"text-align: center; \\">Innvik fjordhotell er eit hotell for både kvardag og fest. Frå vår fjordrestaurant får du god heimelaga mat og ei nydeleg utsikt utover. Fleksible salar som kan tilpassast i storleik og format i arrangement, mindre møterom og stover, gjer at hotellet vert mykje brukt til alle typar selskap – frå samlingar, møter og firmajubileum, til konformasjon, dåp og bryllaup.<br></p><p style=\\"text-align: center; \\"><img src=\\"https://geotales.io/assets/img/62459b1d6931e.jpeg\\" style=\\"width: 100%; max-width: 262px; height: auto; max-height: 174px;\\"><br></p>"},{"id":"a5b567f3-b0f1-447a-9442-94db42fe36fe","sceneId":"944e430e-b025-44c0-939d-36bcba7f9f05","locked":true,"pos":[0.175,0.2003511235955056],"dim":[0.28306477272727276,0.4320752808988764],"content":"<h1 style=\\"text-align: center; \\"></h1><h1 style=\\"text-align: center; \\"></h1><p style=\\"text-align: center; \\"></p><h1 style=\\"text-align: center; \\">Jb Anleggsservice</h1><p style=\\"text-align: center; \\">Jb Anleggsservice driv med muring med naturstein,tomtar,transport og det meste innafor anleggsvirksomhet</p><p style=\\"text-align: center; \\"><img src=\\"https://geotales.io/assets/img/62459c18a075e.jpeg\\" style=\\"width: 100%; max-width: 234px; height: auto; max-height: 174px;\\"><br></p>"},{"id":"10f5afda-f177-47d7-88a4-2b177fbaea4b","sceneId":"27036255-0e64-4513-b162-a818d330e367","locked":true,"pos":[0.175,0.2003511235955056],"dim":[0.28306477272727276,0.4320752808988764],"content":"<h1 style=\\"text-align: center; \\"></h1><h1 style=\\"text-align: center; \\"></h1><p style=\\"text-align: center; \\"></p><h1 style=\\"text-align: center; \\"></h1><h1 style=\\"text-align: center; \\">Café Gobeten</h1><p style=\\"text-align: center; \\">Café Gobeten tilbyr idag ein rikhaldig a la carte meny, der du m.a. finn hjortekarbonader, torskeloin, kvalbiff og svinekjaker i Ægirøl, i tillegg til meir vanlege rettar som f.eks. biffsnadder og kyllinglår. Vi legg stor vekt på å lage maten fra botnen av og nyttar kun gode råvarer.</p><p style=\\"text-align: center; \\"><img src=\\"https://geotales.io/assets/img/62459e300f1dd.png\\" style=\\"width: 100%; max-width: 235px; height: auto; max-height: 186px;\\"><br></p><p style=\\"text-align: center; \\"></p>"},{"id":"805a38db-fc9b-440c-b5f0-da315a3ce4d0","sceneId":"9d58631a-2f4d-43d3-bafe-9a20bc1c24ed","locked":true,"pos":[0.175,0.2003511235955056],"dim":[0.28306477272727276,0.4320752808988764],"content":"<h1 style=\\"text-align: center; \\"></h1><h1 style=\\"text-align: center; \\"></h1><p style=\\"text-align: center; \\"></p><h1 style=\\"text-align: center; \\"></h1><h1 style=\\"text-align: center; \\"></h1><h1 style=\\"text-align: center; \\">Filmdigitalisering AS</h1><p style=\\"text-align: center; \\">Filmdigitalisering AS  har spesialisert seg på digitalisering av film, lyd, og lysbilde. På slutten av 90 talet starta Steinar Hilde arbeidet med å bygge opp eit studio for overføring av analog lyd og film til digitalt format.  Vi utfører oppdrag for private kundar, arkiv, museum, kringkasting mfl. Høg kompetanse, og stor interesse for faget gjer at du som kunde kan føle deg trygg på at dei gamle opptaka er i dei beste hender her hos oss!</p><p style=\\"text-align: center; \\"><img src=\\"https://geotales.io/assets/img/62459f7554741.png\\" style=\\"width: 100%; max-width: 208px; height: auto; max-height: 138px;\\"></p><p style=\\"text-align: center; \\"></p>"},{"id":"aa5d4618-8474-4042-8605-1beb016be4fb","sceneId":"e279b840-480a-4d49-8627-4fe3f9fd23ba","locked":true,"pos":[0.08181818181818182,0.2348314606741573],"dim":null,"content":"<h1>Utvalgte bedrifter i Innvik</h1><p><img src=\\"https://geotales.io/assets/img/6245a13701e54.jpeg\\"><br></p>"},{"id":"b4888c3c-9e6f-4f57-b64b-8caae72c9027","sceneId":"0c7890cc-f7cf-4092-8bb8-5c93a15c3789","locked":false,"pos":[0.11477272727272728,0.26439606741573035],"dim":[0.34987954545454547,0.40061460674157306],"content":"<h1 style=\\"text-align: center; \\"></h1><h1 style=\\"text-align: center; \\"></h1><p style=\\"text-align: center; \\"></p><h1 style=\\"text-align: center; \\"></h1><h1 style=\\"text-align: center; \\"></h1><h1 style=\\"text-align: center; \\">Se mer om innvik på&nbsp;<a href=\\"https://innvik.org\\" target=\\"_blank\\" style=\\"font-size: 14px; font-weight: var(--bs-body-font-weight); text-align: var(--bs-body-text-align);\\">https://innvik.org</a></h1><p style=\\"text-align: center;\\"><img src=\\"https://geotales.io/assets/img/6245a232de031.png\\" style=\\"width: 100%; max-width: 295px; height: auto; max-height: 258px;\\"><br></p><p style=\\"text-align: center; \\"></p><p style=\\"text-align: center; \\"></p>"},{"id":"fe3fd233-41c0-4ad6-8c0c-93d7f76c71c0","sceneId":"ea1568eb-1ddd-4979-ade3-c687765fdf3d","locked":true,"pos":[0.08181818181818182,0.2348314606741573],"dim":[0.17604204545454546,0.34421224920802534],"content":"<h1>Innvik Fjordcamp</h1><p>Hos oss har vi hytter i forskjellige størrelser, oppstillingsplass for bobil og campingvogn med mulighet for tilkobling til strøm. Om du liker å reise lett, har vi også teltplasser tilgjengelig!</p><p><img src=\\"https://geotales.io/assets/img/6245b5887c671.png\\" style=\\"width: 100%; max-width: 225px; height: auto; max-height: 154px;\\"><br></p>"}],"objects":[{"id":"26b8a8db-9b44-485a-9333-edc4eb9a67c7","sceneId":"445531df-a411-40d6-b0a5-a452ea15a437","type":"avatar","pos":[[61.84834059606381,6.609579978394323],[61.84793563815977,6.610438285279089]],"icon":"https://geotales.io/assets/img/624588390e434.png","ratio":1,"rounded":false,"angle":0,"borderColor":"#fff700","borderThickness":3,"blur":0,"grayscale":0,"brightness":0,"transparency":0},{"id":"d4fb5fa8-da19-4d65-a13d-d79fe87a354b","sceneId":"78feebfe-40c9-43f2-b220-1c69c19a35fa","type":"avatar","pos":[[61.851805171686195,6.6110697778640315],[61.851029736796654,6.614503005403096]],"icon":"https://geotales.io/assets/img/62458e96e4819.png","ratio":2.088709677419355,"rounded":false,"angle":0,"borderColor":"#fbff00","borderThickness":0,"blur":0,"grayscale":0,"brightness":0,"transparency":0},{"id":"a1314c9b-37da-4383-8d2e-096b87a7e261","sceneId":"12278ec9-1e4f-481e-83d5-5098b3d8b5ef","type":"avatar","pos":[[61.852335254306354,6.612433544942178],[61.85