eg","minZoom":0,"maxZoom":22,"attribution":"&copy; <a href=\\"https://geotales.io\\" target=\\"_blank\\">GeoTales</a>"},"bookmark":false,"title":""},{"id":"343ba61e-4c12-4eb4-be01-f7a0a375484b","bounds":[[37.27842385645373,29.74549385522338],[36.61552763134925,31.30829903100463]],"basemap":{"type":"tiles","url":"https://api.mapbox.com/styles/v1/andreasatakan/ckwjt95pj0zn714lvg9q9p7da/tiles/256/{z}/{x}/{y}?access_token=pk.eyJ1IjoiYW5kcmVhc2F0YWthbiIsImEiOiJjazlndzM1cmUwMnl5M21tZjQ3dXpzeHJnIn0.oE5zp040ZzJj5QgCDznweg","minZoom":0,"maxZoom":22,"attribution":"&copy; <a href=\\"https://geotales.io\\" target=\\"_blank\\">GeoTales</a>"},"bookmark":false,"title":""},{"id":"5b33180f-f6b2-4a31-894a-997407d9626d","bounds":[[37.55328764595765,28.773295514129178],[36.2265501474709,31.898905865691678]],"basemap":{"type":"tiles","url":"https://api.mapbox.com/styles/v1/andreasatakan/ckwjt95pj0zn714lvg9q9p7da/tiles/256/{z}/{x}/{y}?access_token=pk.eyJ1IjoiYW5kcmVhc2F0YWthbiIsImEiOiJjazlndzM1cmUwMnl5M21tZjQ3dXpzeHJnIn0.oE5zp040ZzJj5QgCDznweg","minZoom":0,"maxZoom":22,"attribution":"&copy; <a href=\\"https://geotales.io\\" target=\\"_blank\\">GeoTales</a>"},"bookmark":false,"title":""},{"id":"b5278a23-7168-4a5c-917b-284fa921475a","bounds":[[36.86643755175846,33.71429121612118],[35.52775582793653,36.83990156768369]],"basemap":{"type":"tiles","url":"https://api.mapbox.com/styles/v1/andreasatakan/ckwjt95pj0zn714lvg9q9p7da/tiles/256/{z}/{x}/{y}?access_token=pk.eyJ1IjoiYW5kcmVhc2F0YWthbiIsImEiOiJjazlndzM1cmUwMnl5M21tZjQ3dXpzeHJnIn0.oE5zp040ZzJj5QgCDznweg","minZoom":0,"maxZoom":22,"attribution":"&copy; <a href=\\"https://geotales.io\\" target=\\"_blank\\">GeoTales</a>"},"bookmark":false,"title":""},{"id":"272a1a92-bf7a-4f18-b697-58395a7dc6b4","bounds":[[36.48424477824482,35.058651020265636],[35.81447235785307,36.621456196046886]],"basemap":{"type":"tiles","url":"https://api.mapbox.com/styles/v1/andreasatakan/ckwjt95pj0zn714lvg9q9p7da/tiles/256/{z}/{x}/{y}?access_token=pk.eyJ1IjoiYW5kcmVhc2F0YWthbiIsImEiOiJjazlndzM1cmUwMnl5M21tZjQ3dXpzeHJnIn0.oE5zp040ZzJj5QgCDznweg","minZoom":0,"maxZoom":22,"attribution":"&copy; <a href=\\"https://geotales.io\\" target=\\"_blank\\">GeoTales</a>"},"bookmark":false,"title":""},{"id":"d39fc70f-4a48-4690-8307-eb1c3a944f4e","bounds":[[41.178653972331674,19.489778268475725],[30.44867367928756,44.49466108097573]],"basemap":{"type":"tiles","url":"https://api.mapbox.com/styles/v1/andreasatakan/ckwjt95pj0zn714lvg9q9p7da/tiles/256/{z}/{x}/{y}?access_token=pk.eyJ1IjoiYW5kcmVhc2F0YWthbiIsImEiOiJjazlndzM1cmUwMnl5M21tZjQ3dXpzeHJnIn0.oE5zp040ZzJj5QgCDznweg","minZoom":0,"maxZoom":22,"attribution":"&copy; <a href=\\"https://geotales.io\\" target=\\"_blank\\">GeoTales</a>"},"bookmark":true,"title":"End"}],"textboxes":[{"id":"43d167f8-d9ee-44ee-83e7-8085479a2622","sceneId":"94594918-0663-41e3-9604-c5ba2826fc57","locked":true,"dim":[0,0.30887745358090185],"content":"<h2 style=\\"text-align: center;\\"><span style=\\"font-family: Palatino Linotype, Book Antiqua, Palatino, serif;\\">SAINT PAUL'S FIRST MISSIONARY JOURNEY</span></h2><div style=\\"text-align: center;\\"><h4><span style=\\"font-family: Palatino Linotype, Book Antiqua, Palatino, serif;\\">As described in Acts chapters 13 and 14 in The Holy Bible, King James Version</span></h4><p style=\\"text-align: left;\\"><br></p></div><div style=\\"text-align: center;\\"><img src=\\"https://geotales.io/assets/img/624591fd2ce45.jpeg\\" style=\\"width: 100%; max-width: 297px; height: auto; max-height: 374px;\\"></div>"},{"id":"3414d8a2-603d-4a6b-bfef-de27bc77308f","sceneId":"be82fd20-629f-40af-94fc-4b7f708a6fd4","locked":true,"dim":[0,0.340498673740053],"content":"<div><h3><span style=\\"font-family: Palatino Linotype, Book Antiqua, Palatino, serif;\\">Acts Chapter 13</span></h3></div><div><span style=\\"font-family: Palatino Linotype, Book Antiqua, Palatino, serif;\\"><b>1</b> Now there were in the church that was at Antioch certain prophets and teachers; as Barnabas, and Simeon that was called Niger, and Lucius of Cyrene, and Manaen, which had been brought up with Herod the tetrarch, and Saul.<br><b>2</b> As they ministered to the Lord, and fasted, the Holy Ghost said, Separate me Barnabas and Saul for the work whereunto I have called them.<br><b>3</b> And when they had fasted and prayed, and laid their hands on them, they sent them away.<br></span></div><div><span style=\\"font-family: Palatino Linotype, Book Antiqua, Palatino, serif;\\"><br></span></div><img src=\\"https://geotales.io/assets/img/62459358b2d5b.jpg\\"><div style=\\"text-align: center;\\"></div>"},{"id":"f64a5784-e17e-4e04-83da-e50bcbecc241","sceneId":"a9864411-a762-4519-9666-549d4161383e","locked":true,"dim":[0,0.2778992042440318],"content":"<p><span style=\\"font-family: Palatino Linotype, Book Antiqua, Palatino, serif;\\"><b>4</b> So they, being sent forth by the Holy Ghost, departed unto Seleucia; and from thence they sailed to Cyprus</span></p><div style=\\"text-align: center;\\"><img src=\\"https://geotales.io/assets/img/62459437ec86d.jpeg\\" style=\\"width: 100%; max-width: 292px; height: auto; max-height: 207px;\\"></div><div style=\\"text-align: center;\\"></div>"},{"id":"a4f4672c-bb07-4333-9736-36e0ac6e796e","sceneId":"4ceb735b-de19-4d5f-96e5-3fc45404862f","locked":true,"dim":[0,0.30235437665782494],"content":"<p><span style=\\"font-family: Palatino Linotype, Book Antiqua, Palatino, serif;\\"><b>4</b> So they, being sent forth by the Holy Ghost, departed unto Seleucia; and from thence they sailed to Cyprus</span></p><div style=\\"text-align: center;\\"><img src=\\"https://geotales.io/assets/img/624595eb2d153.jpeg\\"></div><div style=\\"text-align: center;\\"></div><div style=\\"text-align: center;\\"></div>"},{"id":"83c715ea-4537-4eae-883c-4a9f8ce9ac4b","sceneId":"441e5cfe-fad4-4064-9753-f6dce8559826","locked":true,"dim":[0,0.3235225464190981],"content":"<p><span style=\\"font-family: Palatino Linotype, Book Antiqua, Palatino, serif;\\"><b>5</b> And when they were at Salamis, they preached the word of God in the synagogues of the Jews: and they had also John to their minister.</span></p><img src=\\"https://geotales.io/assets/img/6245990d71a8c.jpg\\"><div style=\\"text-align: center;\\"></div><div style=\\"text-align: center;\\"></div><div style=\\"text-align: center;\\"></div>"},{"id":"93cb3774-b249-4db9-b183-bf49da706522","sceneId":"afa66b68-4f10-4593-b36b-01be02fed7eb","locked":true,"dim":[0,0.30442440318302383],"content":"<span style=\\"font-family: Palatino Linotype, Book Antiqua, Palatino, serif;\\"><b>6</b> And when they had gone through the isle unto Paphos, they found a certain sorcerer, a false prophet, a Jew, whose name was Barjesus:<br><b>7</b> Which was with the deputy of the country, Sergius Paulus, a prudent man; who called for Barnabas and Saul, and desired to hear the word of God.<br><b>8</b> But Elymas the sorcerer (for so is his name by interpretation) withstood them, seeking to turn away the deputy from the faith.<br><b>9</b> Then Saul, (who also is called Paul,) filled with the Holy Ghost, set his eyes on him.<br><b>10</b> And said, O full of all subtilty and all mischief, thou child of the devil, thou enemy of all righteousness, wilt thou not cease to pervert the right ways of the Lord?<br></span>"},{"id":"f7f6480b-16a4-4b1e-8ba9-26ede5901984","sceneId":"8892e391-1b8c-4d3e-9097-33aaae8f078e","locked":true,"dim":[0,0.30548541114058353],"content":"<span style=\\"font-family: Palatino Linotype, Book Antiqua, Palatino, serif;\\"><b>11</b> And now, behold, the hand of the Lord is upon thee, and thou shalt be blind, not seeing the sun for a season. And immediately there fell on him a mist and a darkness; and he went about seeking some to lead him by the hand.<br></span><p><span style=\\"font-family: Palatino Linotype, Book Antiqua, Palatino, serif;\\"><b>12</b> Then the deputy, when he saw what was done, believed, being astonished at the doctrine of the Lord.<br></span></p><img src=\\"https://geotales.io/assets/img/62459b11d5d6b.jpeg\\"><p><span style=\\"font-family: Palatino Linotype, Book Antiqua, Palatino, serif;\\"></span></p>"},{"id":"4b713e92-b888-4c1c-adcc-bf68c3178bce","sceneId":"30a490dc-4429-4f9f-98ab-75db046f7c56","locked":true,"dim":[0,0.2869177718832891],"content":"<p><span style=\\"font-family: Palatino Linotype, Book Antiqua, Palatino, serif;\\"><b>13</b> Now when Paul and his company loosed from Paphos, they came to Perga in Pamphylia: and John departing from them returned to Jerusalem</span></p>"},{"id":"9a422908-2874-4dcc-8ee4-25d0e743a358","sceneId":"4ac074ff-0401-41b7-9c51-1ea1a13d3e65","locked":true,"dim":[0,0.2540265251989389],"content":"<p><span style=\\"font-family: Palatino Linotype, Book Antiqua, Palatino, serif;\\"><b>13</b> Now when Paul and his company loosed from Paphos, they came to Perga in Pamphylia: and John departing from them returned to Jerusalem</span></p>"},{"id":"5069cbb9-f769-45f7-a26f-8295f6335a29","sceneId":"e753d3f3-a18c-48ec-9985-8c930565e7c4","locked":true,"dim":[0,0.2625145888594164],"content":"<p><span style=\\"font-family: Palatino Linotype, Book Antiqua, Palatino, serif;\\"><b>13</b> Now when Paul and his company loosed from Paphos, they came to Perga in Pamphylia: and John departing from them returned to Jerusalem</span></p>"},{"id":"56ef4ac4-d16f-4716-bbc1-ca7e5e9c6063","sceneId":"7c6acb72-cb95-4ac6-9452-380b0676bf60","locked":true,"dim":[0,0.26357559681697607],"content":"<p><span style=\\"font-family: Palatino Linotype, Book Antiqua, Palatino, serif;\\"><b>14</b> But when they departed from Perga, they came to Antioch in Pisidia, and went into the synagogue on the sabbath day, and sat down</span></p>"},{"id":"2c97e47b-6d6c-4379-a027-86e69e72853d","sceneId":"6c549ca5-8241-4d18-abea-8b1298ecd6be","locked":true,"dim":[0,0.31397347480106097],"content":"<span style=\\"font-family: Palatino Linotype, Book Antiqua, Palatino, serif;\\"><b>15</b> And after the reading of the law and the prophets the rulers of the synagogue sent unto them, saying, Ye men and brethren, if ye have any word of exhortation for the people, say on.<br><b>16</b> Then Paul stood up, and beckoning with his hand said, Men of Israel, and ye that fear God, give audience.<br><b>17</b> The God of this people of Israel chose our fathers, and exalted the people when they dwelt as strangers in the land of Egypt, and with an high arm brought he them out of it.<br><b>18</b> And about the time of forty years suffered he their manners in the wilderness.<br></span><p><span style=\\"font-family: Palatino Linotype, Book Antiqua, Palatino, serif;\\"><b>19</b> And when he had destroyed seven nations in the land of Chanaan, he divided their land to them by lot.<br></span></p><img src=\\"https://geotales.io/assets/img/6245a1c1cab74.jpg\\"><p><span style=\\"font-family: Palatino Linotype, Book Antiqua, Palatino, serif;\\"></span></p>"},{"id":"abebd96d-ef28-404b-a579-4848607b7b09","sceneId":"aec53d4d-f054-4729-8848-5316a14b4523","locked":true,"dim":[0,0.2985888594164456],"content":"<span style=\\"font-family: Palatino Linotype, Book Antiqua, Palatino, serif;\\"><b>20</b> And after that he gave unto them judges about the space of four hundred and fifty years, until Samuel the prophet.<br><b>21</b> And afterward they desired a king: and God gave unto them Saul the son of Cis, a man of the tribe of Benjamin, by the space of forty years.<br><b>22</b> And when he had removed him, he raised up unto them David to be their king; to whom also he gave their testimony, and said, I have found David the son of Jesse, a man after mine own heart, which shall fulfil all my will.<br><b>23</b> Of this man’s seed hath God according to his promise raised unto Israel a Saviour, Jesus:<br><b>24</b> When John had first preached before his coming the baptism of repentance to all the people of Israel.<br><b>25</b> And as John fulfilled his course, he said, Whom think ye that I am? I am not he. But, behold, there cometh one after me, whose shoes of his feet I am not worthy to loose.<br></span>"},{"id":"453778fb-641b-47f6-ba7b-0b044311b380","sceneId":"cd418e4e-ca8e-4c49-abce-7bb09cfdcce3","locked":true,"dim":[0,0.30071087533156493],"content":"<span style=\\"font-family: Palatino Linotype, Book Antiqua, Palatino, serif;\\"><b>26</b> Men and brethren, children of the stock of Abraham, and whosoever among you feareth God, to you is the word of this salvation sent.<br><b>27</b> For they that dwell at Jerusalem, and their rulers, because they knew him not, nor yet the voices of the prophets which are read every sabbath day, they have fulfilled them in condemning him.<br><b>28</b> And though they found no cause of death in him, yet desired they Pilate that he should be slain.<br><b>29</b> And when they had fulfilled all that was written of him, they took him down from the tree, and laid him in a sepulchre.</span>"},{"id":"c42f7695-3c5e-4987-8137-f8ef6523a43b","sceneId":"7d8785f8-a667-4fb6-97e0-d581408f93ea","locked":true,"dim":[0,0.2667586206896551],"content":"<span style=\\"font-family: Palatino Linotype, Book Antiqua, Palatino, serif;\\"><b>30</b> But God raised him from the dead:<br><b>31</b> And he was seen many days of them which came up with him from Galilee to Jerusalem, who are his witnesses unto the people.<br><b>32</b> And we declare unto you glad tidings, how that the promise which was made unto the fathers,<br><b>33</b> God hath fulfilled the same unto us their children, in that he hath raised up Jesus again; as it is also written in the second psalm, Thou art my Son, this day have I begotten thee.<br><b>34</b> And as concerning that he raised him up from the dead, now no more to return to corruption, he said on this wise, I will give you the sure mercies of David.<br></span>"},{"id":"783fb726-4998-4ce5-b550-01e0b5beab1d","sceneId":"e26bb527-8559-4855-a913-94bdcfb30e67","locked":true,"dim":[0,0.3023023872679045],"content":"<span style=\\"font-family: Palatino Linotype, Book Antiqua, Palatino, serif;\\"><b>35</b> Wherefore he saith also in another psalm, Thou shalt not suffer thine Holy One to see corruption.<br><b>36</b> For David, after he had served his own generation by the will of God, fell on sleep, and was laid unto his fathers, and saw corruption:<br><b>37</b> But he, whom God raised again, saw no corruption.<br><b>38</b> Be it known unto you therefore, men and brethren, that through this man is preached unto you the forgiveness of sins:<br><b>39</b> And by him all that believe are justified from all things, from which ye could not be justified by the law of Moses.<br><b>40</b> Beware therefore, lest that come upon you, which is spoken of in the prophets;<br><b>41</b> Behold, ye despisers, and wonder, and perish: for I work a work in your days, a work which ye shall in no wise believe, though a man declare it unto you.</span>"},{"id":"663205a7-e952-417e-8740-9857c32ee55b","sceneId":"7210ba03-b379-48dd-8a37-25c15fd168b7","locked":true,"dim":[0,0.2948753315649867],"content":"<span style=\\"font-family: Palatino Linotype, Book Antiqua, Palatino, serif;\\"><b>42</b> And when the Jews were gone out of the synagogue, the Gentiles besought that these words might be preached to them the next sabbath.<br><b>43</b> Now when the congregation was broken up, many of the Jews and religious proselytes followed Paul and Barnabas: who, speaking to them, persuaded them to continue in the grace of God.<br><b>44</b> And the next sabbath day came almost the whole city together to hear the word of God.<br></span><p><span style=\\"font-family: Palatino Linotype, Book Antiqua, Palatino, serif;\\"><b>45</b> But when the Jews saw the multitudes, they were filled with envy, and spake against those things which were spoken by Paul, contradicting and blaspheming.</span></p><img src=\\"https://geotales.io/assets/img/6245a4d1d48f0.jpg\\">"},{"id":"14a2ef61-a8af-428e-8cd1-f78f5d6e6f88","sceneId":"c48216e3-abd3-401e-ba85-157b89519c70","locked":true,"dim":[0,0.2667586206896551],"content":"<span style=\\"font-family: Palatino Linotype, Book Antiqua, Palatino, serif;\\"><b>46</b> Then Paul and Barnabas waxed bold, and said, It was necessary that the word of God should first have been spoken to you: but seeing ye put it from you, and judge yourselves unworthy of everlasting life, lo, we turn to the Gentiles.<br><b>47</b> For so hath the Lord commanded us, saying, I have set thee to be a light of the Gentiles, that thou shouldest be for salvation unto the ends of the earth.<br><b>48</b> And when the Gentiles heard this, they were glad, and glorified the word of the Lord: and as many as were ordained to eternal life believed.<br><b>49</b> And the word of the Lord was published throughout all the region.<br></span>"},{"id":"3ce2d161-978a-49f8-9b9b-b9f0151760bd","sceneId":"3af2d950-d958-4884-8506-66242af78c9d","locked":true,"dim":[0,0.2550875331564986],"content":"<span style=\\"font-family: Palatino Linotype, Book Antiqua, Palatino, serif;\\"><b>50</b> But the Jews stirred up the devout and honourable women, and the chief men of the city, and raised persecution against Paul and Barnabas, and expelled them out of their coasts.<br><b>51</b> But they shook off the dust of their feet against them, and came unto Iconium.<br><b>52</b> And the disciples were filled with joy, and with the Holy Ghost.</span>"},{"id":"8318f66e-c772-4d4d-8e05-e74490f8a764","sceneId":"f0ef6144-c929-4117-bdad-0b216323648a","locked":true,"dim":[0,0.28373474801061005],"content":"<h3><span style=\\"font-family: Palatino Linotype, Book Antiqua, Palatino, serif;\\">Chapter 14</span></h3><span style=\\"font-family: Palatino Linotype, Book Antiqua, Palatino, serif;\\"><b>1</b> And it came to pass in Iconium, that they went both together into the synagogue of the Jews, and so spake, that a great multitude both of the Jews and also of the Greeks believed.<br><b>2</b> But the unbelieving Jews stirred up the Gentiles, and made their minds evil affected against the brethren.<br><b>3</b> Long time therefore abode they speaking boldly in the Lord, which gave testimony unto the word of his grace, and granted signs and wonders to be done by their hands.<br><b>4</b> But the multitude of the city was divided: and part held with the Jews, and part with the apostles.<br></span><p><span style=\\"font-family: Palatino Linotype, Book Antiqua, Palatino, serif;\\"><b>5</b> And when there was an assault made both of the Gentiles, and also of the Jews with their rulers, to use them despitefully, and to stone them,</span></p><img src=\\"https://geotales.io/assets/img/6245a6df0aab1.jpg\\">"},{"id":"4dd5d67c-fc11-4b85-a8bf-baca5dff1b99","sceneId":"33066bc8-0d08-4c44-a42f-0e319dd1ffb0","locked":true,"dim":[0,0.270472148541114],"content":"<span style=\\"font-family: Palatino Linotype, Book Antiqua, Palatino, serif;\\"><b>6</b> They were ware of it, and fled unto Lystra and Derbe, cities of Lycaonia, and unto the region that lieth round about:<br><b>7</b> And there they preached the gospel.<br></span>"},{"id":"260ad60b-f5a8-4258-b4dc-dc5c2c3e71ad","sceneId":"d4bb34d5-448b-4c92-999b-8f645f792647","locked":true,"dim":[0,0.290631299734748],"content":"<span style=\\"font-family: Palatino Linotype, Book Antiqua, Palatino, serif;\\"><b>8</b> And there sat a certain man at Lystra, impotent in his feet, being a cripple from his mother’s womb, who never had walked:<br><b>9</b> The same heard Paul speak: who stedfastly beholding him, and perceiving that he had faith to be healed,<br></span><p><span style=\\"font-family: Palatino Linotype, Book Antiqua, Palatino, serif;\\"><b>10</b> Said with a loud voice, Stand upright on thy feet. And he leaped and walked.</span></p><img src=\\"https://geotales.io/assets/img/6245a7efc0d54.jpeg\\">"},{"id":"972a669f-260d-43f0-815d-a7ef93080206","sceneId":"c20aac60-583f-4b0e-9878-89e564d5a03f","locked":true,"dim":[0,0.28532625994694955],"content":"<span style=\\"font-family: Palatino Linotype, Book Antiqua, Palatino, serif;\\"><b>11</b> And when the people saw what Paul had done, they lifted up their voices, saying in the speech of Lycaonia, The gods are come down to us in the likeness of men.<br><b>12</b> And they called Barnabas, Jupiter; and Paul, Mercurius, because he was the chief speaker.<br><b>13</b> Then the priest of Jupiter, which was before their city, brought oxen and garlands unto the gates, and would have done sacrifice with the people.<br><b>14</b> Which when the apostles, Barnabas and Paul, heard of, they rent their clothes, and ran in among the people, crying out,<br><b>15</b> And saying, Sirs, why do ye these things? We also are men of like passions with you, and preach unto you that ye should turn from these vanities unto the living God, which made heaven, and earth, and the sea, and all things that are therein:<br><b>16</b> Who in times past suffered all nations to walk in their own ways.<br><b>17</b> Nevertheless he left not himself without witness, in that he did good, and gave us rain from heaven, and fruitful seasons, filling our hearts with food and gladness.<br></span><p><span style=\\"font-family: Palatino Linotype, Book Antiqua, Palatino, serif;\\"><b>18</b> And with these sayings scarce restrained they the people, that they had not done sacrifice unto them.<br></span></p><img src=\\"https://geotales.io/assets/img/6245a8e6b69b2.jpeg\\"><p><span style=\\"font-family: Palatino Linotype, Book Antiqua, Palatino, serif;\\"></span></p>"},{"id":"e28d66e7-b941-4d5c-9720-39bda92a9910","sceneId":"09291524-4cba-42f9-aad8-95d98f37006b","locked":true,"dim":[0,0.28002122015915115],"content":"<p><span style=\\"font-family: Palatino Linotype, Book Antiqua, Palatino, serif;\\"><b>19</b> And there came thither certain Jews from Antioch and Iconium, who persuaded the people, and having stoned Paul, drew him out of the city, supposing he had been dead.</span></p><img src=\\"https://geotales.io/assets/img/6245a98d8ec96.jpeg\\">"},{"id":"eaa0da58-ea8e-4de7-b1fa-83145dea197c","sceneId":"311f97ff-530e-45cf-a9f2-702b483b8784","locked":true,"dim":[0,0.28002122015915115],"content":"<span style=\\"font-family: Palatino Linotype, Book Antiqua, Palatino, serif;\\"><b>20</b> Howbeit, as the disciples stood round about him, he rose up, and came into the city: (...)<br></span>"},{"id":"9a77abea-542d-4103-9283-d03c4df1b250","sceneId":"50cc0377-eaf6-427c-b6a5-107d04ae359a","locked":true,"dim":[0,0.2519045092838196],"content":"<p><span style=\\"font-family: Palatino Linotype, Book Antiqua, Palatino, serif;\\">(...) and the next day he departed with Barnabas to Derbe</span></p>"},{"id":"409cc064-1da1-4e8c-8222-e69d47ea8025","sceneId":"b32f1e33-c4d8-43ee-b923-57555818a8f5","locked":true,"dim":[0,0.2741856763925729],"content":"<p><span style=\\"font-family: Palatino Linotype, Book Antiqua, Palatino, serif;\\"><b>21</b> And when they had preached the gospel to that city, and had taught many, they returned again to Lystra, (...)</span></p>"},{"id":"6d7bfa2a-d56c-4651-8ad7-30bb6346893d","sceneId":"0295291e-30b5-413e-8aaf-dd403cda8497","locked":true,"dim":[0,0.24394694960212196],"content":"<p><span style=\\"font-family: Palatino Linotype, Book Antiqua, Palatino, serif;\\">(...) and to Iconium, (...)</span></p>"},{"id":"17c6bf80-7175-4dd6-988e-ae98e424299b","sceneId":"8241d591-d64b-4e8d-ab92-0b62a7f6300a","locked":true,"dim":[0,0.26569761273209547],"content":"<span style=\\"font-family: Palatino Linotype, Book Antiqua, Palatino, serif;\\">(...) and Antioch,<br><b>22</b> Confirming the souls of the disciples, and exhorting them to continue in the faith, and that we must through much tribulation enter into the kingdom of God.<br><b>23</b> And when they had ordained them elders in every church, and had prayed with fasting, they commended them to the Lord, on whom they believed.</span>"},{"id":"03038d11-3259-472a-81a6-bee0b6c76eb7","sceneId":"38d6af9b-d415-4249-ab2a-00124a614798","locked":true,"dim":[0,0.2365198938992042],"content":"<p><span style=\\"font-family: Palatino Linotype, Book Antiqua, Palatino, serif;\\"><b>24</b> And after they had passed throughout Pisidia, they came to Pamphylia</span></p>"},{"id":"9d8ab26c-c513-42a1-a276-18c16975687d","sceneId":"343ba61e-4c12-4eb4-be01-f7a0a375484b","locked":true,"dim":[0,0.23174535809018562],"content":"<p><span style=\\"font-family: Palatino Linotype, Book Antiqua, Palatino, serif;\\"><b>25</b> And when they had preached the word in Perga, they went down into Attalia:</span></p>"},{"id":"dd0cd93d-fe87-4bb5-a3ba-e7f940315177","sceneId":"5b33180f-f6b2-4a31-894a-997407d9626d","locked":true,"dim":[0,0.2402334217506631],"content":"<p><span style=\\"font-family: Palatino Linotype, Book Antiqua, Palatino, serif;\\"><b>25</b> And when they had preached the word in Perga, they went down into Attalia:</span></p>"},{"id":"6a4865c1-e7f2-490f-9aa6-05e4e6feb6f3","sceneId":"b5278a23-7168-4a5c-917b-284fa921475a","locked":true,"dim":[0,0.2513740053050397],"content":"<p><span style=\\"font-family: Palatino Linotype, Book Antiqua, Palatino, serif;\\"><b>26</b> And thence sailed to Antioch, from whence they had been recommended to the grace of God for the work which they fulfilled.</span></p>"},{"id":"d4f363dd-503a-453e-b0fd-9d28796463d4","sceneId":"272a1a92-bf7a-4f18-b697-58395a7dc6b4","locked":true,"dim":[0,0.26092307692307687],"content":"<span style=\\"font-family: Palatino Linotype, Book Antiqua, Palatino, serif;\\"><b>27</b> And when they were come, and had gathered the church together, they rehearsed all that God had done with them, and how he had opened the door of faith unto the Gentiles.<br><b>28</b> And there they abode long time with the disciples.</span>"}],"objects":[{"id":"ac45d293-38c9-4b9b-8732-154de8ac5515","sceneId":"be82fd20-629f-40af-94fc-4b7f708a6fd4","type":"avatar","pos":[[36.19995805932895,36.12991272680202],[36.11364858007716,36.167678229731706]],"icon":"https://geotales.io/assets/img/624593b51c015.png","ratio":0.35328753680078506,"rounded":false,"angle":0,"borderColor":"#563d7c","borderThickness":0,"blur":0,"grayscale":0,"brightness":