</p><p><br></p><p><span style=\\"font-family: Georgia, serif;\\" data-tbw-flag=\\"true\\">Bruk piltaster nederst for å bytte slide. Ses best i fullskjerm-modus på laptop eller stasjonær pc.</span></p><div></div><div><span style=\\"font-family: Georgia, serif;\\" data-tbw-flag=\\"true\\">Se hele kartet når som helst ved å trykke hengelåsen nederst til høyre.</span></div><div><img src=\\"https://geotales.s3.eu-north-1.amazonaws.com/62ed41c8ca420.png\\"></div><div><br></div><div>Dokumentasjon: <a href=\\"http://nfedb.no/SABIMA-indikatorer-Dokumentasjon.pdf\\" target=\\"_blank\\">http://nfedb.no/SABIMA-indikatorer-Dokumentasjon.pdf</a></div><div><br></div><div style=\\"text-align: center;\\"><b><i><span style=\\"font-family: Georgia, serif;\\" data-tbw-flag=\\"true\\">Laget med GeoTales</span></i></b></div><div style=\\"text-align: center;\\"><b><i><span style=\\"font-family: Georgia, serif;\\" data-tbw-flag=\\"true\\"><br></span></i></b></div><div style=\\"text-align: center;\\"><img src=\\"https://geotales.s3.eu-north-1.amazonaws.com/62ed41fb1a209.png\\" style=\\"width: 100%; max-width: 329px; height: auto; max-height: 286px;\\"></div><br>"},{"id":"6990f759-b790-4ea6-8a0a-6db46cfcd830","sceneId":"032bd91d-d2c9-4cec-a03c-5847f4c1cd9e","locked":false,"pos":"left","dim":[0,0.25],"content":"<h4><span style=\\"font-family: Georgia, serif;\\">Planlagte bebyggelsesområder i Viken</span></h4><p><span style=\\"font-family: Georgia, serif;\\"><span style=\\"background-color: rgb(229, 224, 236);\\">&nbsp;&nbsp;</span> Bebyggelsesområder<br><span style=\\"background-color: rgb(247, 150, 70);\\">&nbsp;&nbsp;</span> Kommunegrenser<br></span></p>"},{"id":"2ba60c12-afe6-4831-8880-c702e0b70462","sceneId":"88395936-bdcb-467c-9b3a-3d6343d42d77","locked":false,"pos":"left","dim":[0,0.25],"content":"<h4><span style=\\"font-family: Georgia, serif;\\">Elvekant – 100 meter på hver side av elv<br></span></h4><div><span style=\\"font-family: Georgia, serif;\\">Elvekant indikator; områder som overlapper mellom planlagte bebyggelsesområder i kommuneplan og elvnett med 100 meters buffer.</span></div><div><span style=\\"font-family: Georgia, serif;\\"><span style=\\"background-color: rgb(229, 224, 236);\\">&nbsp;&nbsp;</span> Bebyggelsesområder<span style=\\"background-color: rgb(255, 0, 0);\\"><br>&nbsp;&nbsp;</span> Overlapp<br><span style=\\"background-color: rgb(149, 179, 215);\\">&nbsp;&nbsp;</span> Elver<br></span></div>"},{"id":"79bf0dd4-a718-4846-be16-48b931e7967f","sceneId":"4119f117-b422-4a14-9e87-53cb5cbb12b6","locked":false,"pos":"left","dim":[0,0.25],"content":"<h4><span style=\\"font-family: Georgia, serif;\\">Ferskvann – 100 meter buffer</span></h4><p><span style=\\"font-family: Georgia, serif;\\">Ferskvann indikator; områder som overlapper mellom planlagte bebyggelsesområder i kommuneplan og ferskvannsområder med 100 meters buffer.<br></span></p><p><span style=\\"font-family: Georgia, serif;\\"><span style=\\"background-color: rgb(229, 224, 236);\\">&nbsp;&nbsp;</span> Bebyggelsesområder<span style=\\"background-color: rgb(255, 0, 0);\\"><br>&nbsp;&nbsp;</span> Overlapp<br><span style=\\"background-color: rgb(149, 179, 215);\\">&nbsp;&nbsp;</span> Ferskvannsområder<br></span></p>"},{"id":"2a6225c3-594a-44e0-bc59-e5298b0c78ee","sceneId":"4ef5aa7a-3a96-4c74-a71c-3c22c0fac7ec","locked":false,"pos":"left","dim":[0,0.25],"content":"<h4><span style=\\"font-family: Georgia, serif;\\">Kulturlandskap<br></span></h4><p><span style=\\"font-family: Georgia, serif;\\">Kulturlandskap indikator; områder som overlapper mellom planlagte bebyggelsesområder i kommuneplan og kulturlandskap.<br></span></p><p><span style=\\"font-family: Georgia, serif;\\"><span style=\\"background-color: rgb(229, 224, 236);\\">&nbsp;&nbsp;</span> Bebyggelsesområder<span style=\\"background-color: rgb(255, 0, 0);\\"><br>&nbsp;&nbsp;</span> Overlapp<br><span style=\\"background-color: rgb(242, 195, 20);\\">&nbsp;&nbsp;</span> Kulturlandskap<br></span></p>"},{"id":"f0f7db36-2cc8-4213-b985-69119e195be4","sceneId":"1f3235b6-b5f9-4eb2-b414-f052bd5c7c48","locked":false,"pos":"left","dim":[0,0.25],"content":"<h4><span style=\\"font-family: Georgia, serif;\\">Myr</span></h4><p><span style=\\"font-family: Georgia, serif;\\">Myr indikator; områder som overlapper mellom planlagte bebyggelsesområder i kommuneplan og myrområder.<br></span></p><p><span style=\\"font-family: Georgia, serif;\\"><span style=\\"background-color: rgb(229, 224, 236);\\">&nbsp;&nbsp;</span> Bebyggelsesområder<span style=\\"background-color: rgb(255, 0, 0);\\"><br>&nbsp;&nbsp;</span> Overlapp<br><span style=\\"background-color: rgb(149, 179, 215);\\">&nbsp;&nbsp;</span> Myr, blått og/eller hvitt<br></span></p>"},{"id":"dc960b9e-8b4a-46d5-a145-b02a5eb7bc88","sceneId":"55dc7074-8e47-4bcc-9792-c915feb1c911","locked":false,"pos":"left","dim":[0,0.25],"content":"<h4><span style=\\"font-family: Georgia, serif;\\">Skog</span></h4><p><span style=\\"font-family: Georgia, serif;\\">Skog indikator; områder som overlapper mellom planlagte bebyggelsesområder i kommuneplan og skogsområder.<br></span></p><p><span style=\\"font-family: Georgia, serif;\\"><span style=\\"background-color: rgb(229, 224, 236);\\">&nbsp;&nbsp;</span> Bebyggelsesområder<span style=\\"background-color: rgb(255, 0, 0);\\"><br>&nbsp;&nbsp;</span> Overlapp<br><span style=\\"background-color: rgb(155, 187, 89);\\">&nbsp;&nbsp;</span> Skog, grønt og gult<br></span></p>"},{"id":"41cd6f43-34c5-4395-a701-e6c71e83c1f0","sceneId":"2c8cfad8-41b7-476d-8b9f-d05dd569ea13","locked":false,"pos":"left","dim":[0,0.25],"content":"<h4><span style=\\"font-family: Georgia, serif;\\">Strandsone – 100 meter buffer</span></h4><p><span style=\\"font-family: Georgia, serif;\\">Strandsone indikator; områder som overlapper mellom planlagte bebyggelsesområder i kommuneplan og kystkontur med 100 meters buffer.<span style=\\"background-color: rgb(229, 224, 236);\\"><br></span></span></p><p><span style=\\"font-family: Georgia, serif;\\"><span style=\\"background-color: rgb(229, 224, 236);\\">&nbsp;&nbsp;</span> Bebyggelsesområder<span style=\\"background-color: rgb(255, 0, 0);\\"><br>&nbsp;&nbsp;</span> Overlapp<br></span></p>"},{"id":"fbaa7902-86a1-4476-adad-954179d89c8e","sceneId":"fdc1f1a1-4194-46e4-9833-6fedcd02cd8d","locked":false,"pos":"left","dim":[0,0.25],"content":"<h4><span style=\\"font-family: Georgia, serif;\\">Endring fra gul til grønn</span></h4><p><span style=\\"font-family: Georgia, serif;\\">For alle kommuner i tidligere Østfold fylke; alle områder som overlapper mellom Gule områder i forrige versjon av kommuneplan, etter nåværnede kommuneinndelign, og Grønne områder i nåværende versjon av kommuneplan, også etter nåværnede kommuneinndelign.<br></span></p><p><span style=\\"font-family: Georgia, serif;\\"><span style=\\"background-color: rgb(229, 224, 236);\\">&nbsp;&nbsp;</span> Bebyggelsesområder<br><span style=\\"background-color: rgb(155, 187, 89);\\">&nbsp;&nbsp;</span> Endringsområder<br></span></p>"},{"id":"a0c15c64-c560-4d2b-8247-b34521bb1715","sceneId":"55ff5f82-7661-4324-b8ed-343f74e465ad","locked":false,"pos":"left","dim":[0,0.25],"content":"<h4 style=\\"text-align: center;\\"><i><span style=\\"font-family: Georgia, serif;\\">Laget med GeoTales</span></i></h4><div><br></div><div><img src=\\"https://geotales.s3.eu-north-1.amazonaws.com/62ee5fcc802cc.png\\"></div><br>"}],"objects":[]}	
